import logo from "./logo.svg";
import "./App.css";
import { useEffect, useState } from "react";
import Table from "./Table";
import axios from "axios";

function App() {
  const [inputParams, setInputParams] = useState({
    appName: "",
    clientId: "",
    clientSecret: "",
    storageAccountName: "",
    storageAccountKey: "",
    tenantId: "",
    containerName: "",
    filePath: "",
    fileName: "",
    condition: "",
  });
  const [headers, setHeaders] = useState([]);
  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    if (tableData.length > 0) {
      setHeaders(Object.keys(tableData[0]));
    }
  }, [tableData]);

  function loadData() {
    // axios.get("http://localhost:8080/api/spark/read/taxidata").then((data) => {
    //   setTableData(data.data);
    // });
    console.log(inputParams);
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>Azure Data UI</div>
      </header>
      <h1>Form</h1>
      <form onSubmit={() => loadData()}>
        <div className="form-element">
          <label>App Name</label>
          <input
            value={inputParams.appName}
            onChange={(event) =>
              setInputParams({ ...inputParams, appName: event.target.value })
            }
          ></input>
        </div>
        <div className="form-element"></div>
        <label>Client ID</label>
        <input
          value={inputParams.clientId}
          onChange={(event) =>
            setInputParams({ ...inputParams, clientId: event.target.value })
          }
        ></input>
        <div className="form-element"></div>
        <label>Client Secret</label>
        <input
          value={inputParams.clientSecret}
          onChange={(event) =>
            setInputParams({ ...inputParams, clientSecret: event.target.value })
          }
        ></input>
        <div className="form-element"></div>
        <label>Storage Account Name</label>
        <input
          value={inputParams.storageAccountName}
          onChange={(event) =>
            setInputParams({
              ...inputParams,
              storageAccountName: event.target.value,
            })
          }
        ></input>
        <div className="form-element"></div>
        <label>Storage Account Key</label>
        <input
          value={inputParams.storageAccountKey}
          onChange={(event) =>
            setInputParams({
              ...inputParams,
              storageAccountKey: event.target.value,
            })
          }
        ></input>
        <div className="form-element"></div>
        <label>Tenant Id</label>
        <input
          value={inputParams.tenantId}
          onChange={(event) =>
            setInputParams({ ...inputParams, tenantId: event.target.value })
          }
        ></input>
        <div className="form-element">
          <label>Container Name</label>
          <input
            value={inputParams.containerName}
            onChange={(event) =>
              setInputParams({
                ...inputParams,
                containerName: event.target.value,
              })
            }
          ></input>
        </div>
        <div className="form-element">
          <label>File Path</label>
          <input
            value={inputParams.filePath}
            onChange={(event) =>
              setInputParams({ ...inputParams, filePath: event.target.value })
            }
          ></input>
        </div>
        <div className="form-element">
          <label>File Name</label>
          <input
            value={inputParams.fileName}
            onChange={(event) =>
              setInputParams({ ...inputParams, fileName: event.target.value })
            }
          ></input>
        </div>
        <div className="form-element">
          <label>Condition</label>
          <input
            value={inputParams.condition}
            onChange={(event) =>
              setInputParams({ ...inputParams, condition: event.target.value })
            }
          ></input>
        </div>
      </form>

      <h1>Display table data</h1>
      <button className="display-button" onClick={() => loadData()}>
        {" "}
        Display Data
      </button>
      <div className="table">
        <Table headers={headers} data={tableData}></Table>
      </div>
    </div>
  );
}

export default App;
